import React from 'react';

const SocialFloatingBar = () => {
  const socials = [
    { href: 'https://github.com/Uwisss', icon: 'fab fa-github', label: 'GitHub', className: 'github' },
    { href: 'https://www.linkedin.com/in/dimapilis-carl-luis-c-66b63631b/', icon: 'fab fa-linkedin-in', label: 'LinkedIn', className: 'linkedin' },
    { href: 'https://instagram.com/not.owes', icon: 'fab fa-instagram', label: 'Instagram', className: 'instagram' },
    { href: 'https://www.facebook.com/carlluis.dimapilis', icon: 'fab fa-facebook-f', label: 'Facebook', className: 'facebook' },
    { href: 'https://www.tiktok.com/@crllss', icon: 'fab fa-tiktok', label: 'TikTok', className: 'tiktok' }
  ];

  return (
    <div className="social-floating-bar">
      {socials.map((social, index) => (
        <a 
          key={index}
          href={social.href} 
          target="_blank" 
          rel="noopener noreferrer" 
          className={social.className}
          data-tooltip={social.label}
        >
          <i className={social.icon}></i>
        </a>
      ))}
    </div>
  );
};

export default SocialFloatingBar;
